// Toolbar.js

import React from 'react';
import { Link } from 'react-router-dom'; // If using React Router for navigation

const Toolbar = () => {
  return (
    <div className="toolbar">
      <Link to="/">Home</Link>
      <button onClick={() => console.log('Button clicked')}>Click me</button>
    </div>
  );
};

export default Toolbar;
